import{_ as a}from"./chunks/sdk_logo_full.DkiZxF1Q.js";import{_ as t,c as i,al as r,o as s}from"./chunks/framework.JotrKMnz.js";const f=JSON.parse('{"title":"MAVSDK C++ Library","description":"","frontmatter":{"github_branch":"v3"},"headers":[],"relativePath":"en/cpp/index.md","filePath":"en/cpp/index.md"}'),o={name:"en/cpp/index.md"};function n(l,e,c,h,m,d){return s(),i("div",null,e[0]||(e[0]=[r('<h1 id="mavsdk-c-library" tabindex="-1">MAVSDK C++ Library <div style="float:right;padding:10px;margin-right:20px;"><img src="'+a+'" title="MAVSDK Logo" width="180px"></div> <a class="header-anchor" href="#mavsdk-c-library" aria-label="Permalink to &quot;MAVSDK C++ Library &lt;div style=&quot;float:right; padding:10px; margin-right:20px;&quot;&gt;&lt;img src=&quot;../../assets/site/sdk_logo_full.png&quot; title=&quot;MAVSDK Logo&quot; width=&quot;180px&quot;/&gt;&lt;/div&gt;&quot;">​</a></h1><p><a href="http://slack.px4.io" target="_blank" rel="noreferrer"><img src="https://px4-slack.herokuapp.com/badge.svg" alt="Slack"></a> <a href="https://discuss.px4.io/c/sdk" target="_blank" rel="noreferrer"><img src="https://img.shields.io/badge/discuss-MAVSDK-ff69b4.svg" alt="Discuss"></a> <a href="https://github.com/mavlink/MAVSDK/actions?query=branch%3Amain" target="_blank" rel="noreferrer"><img src="https://github.com/mavlink/MAVSDK/workflows/Build%20and%20Test/badge.svg?branch=main" alt="GitHub Actions Status"></a> <a href="https://coveralls.io/github/mavlink/MAVSDK?branch=main" target="_blank" rel="noreferrer"><img src="https://coveralls.io/repos/github/mavlink/MAVSDK/badge.svg?branch=main" alt="Coverage Status"></a></p><p>The MAVSDK C++ library provides a simple C++ API for managing one or more vehicles via MAVLink. It enables programmatic access to vehicle information and telemetry, and control over missions, movement and other operations. The C++ library is designed to be performant, and can be used to enable tasks like computer vision, obstacle avoidance, and route planning.</p><h2 id="project-status" tabindex="-1">Project Status <a class="header-anchor" href="#project-status" aria-label="Permalink to &quot;Project Status&quot;">​</a></h2><p>The MAVSDK C++ library is a robust and well-tested library that is in use in production environments. Note however that the API is still being evolved and the project does not provide future compatibility guarantees.</p><h2 id="getting-started" tabindex="-1">Getting Started <a class="header-anchor" href="#getting-started" aria-label="Permalink to &quot;Getting Started&quot;">​</a></h2><p>Check out the <a href="./quickstart.html">QuickStart guide</a> to get started.</p><p>A simple complete example can be found in <a href="./examples/takeoff_and_land.html">Takeoff and Land</a>.</p><h2 id="updating-api-changes" tabindex="-1">Updating / API changes <a class="header-anchor" href="#updating-api-changes" aria-label="Permalink to &quot;Updating / API changes&quot;">​</a></h2><p>Information about API changes between versions: <a href="./api_changes.html">API changes</a>.</p><h2 id="api-overview" tabindex="-1">API Overview <a class="header-anchor" href="#api-overview" aria-label="Permalink to &quot;API Overview&quot;">​</a></h2><p><a href="./api_reference/classmavsdk_1_1_mavsdk.html">Mavsdk</a> is the main library class. API consumers use <a href="./api_reference/classmavsdk_1_1_mavsdk.html">Mavsdk</a> to discover and access vehicles (<a href="./api_reference/classmavsdk_1_1_system.html">System</a> objects), which in turn provide access to all other drone information and control objects (e.g. <a href="./api_reference/classmavsdk_1_1_telemetry.html">Telemetry</a>, <a href="./api_reference/classmavsdk_1_1_mission.html">Mission</a> etc.).</p><p>The most important classes are:</p><ul><li><a href="./api_reference/classmavsdk_1_1_mavsdk.html">Mavsdk</a>: Discover and connect to vehicles (<a href="./api_reference/classmavsdk_1_1_system.html">System</a>).</li><li><a href="./api_reference/classmavsdk_1_1_system.html">System</a>: Represents a connected vehicle (e.g. a copter or VTOL drone). It provides access to vehicle information and control through the classes listed below.</li><li><a href="./api_reference/classmavsdk_1_1_info.html">Info</a>: Basic version information about the hardware and/or software of a system.</li><li><a href="./api_reference/classmavsdk_1_1_telemetry.html">Telemetry</a>: Get vehicle telemetry and state information and set telemetry update rates.</li><li><a href="./api_reference/classmavsdk_1_1_action.html">Action</a>: Simple drone actions including arming, taking off, and landing.</li><li><a href="./api_reference/classmavsdk_1_1_mission.html">Mission</a>: Waypoint mission creation and upload/download. Missions are created from <a href="./api_reference/structmavsdk_1_1_mission_1_1_mission_item.html">MissionItem</a> objects.</li><li><a href="./api_reference/classmavsdk_1_1_offboard.html">Offboard</a>: Control a drone with velocity commands.</li><li><a href="./api_reference/classmavsdk_1_1_geofence.html">Geofence</a>: Specify a geofence.</li><li><a href="./api_reference/classmavsdk_1_1_gimbal.html">Gimbal</a>: Control a gimbal.</li><li><a href="./api_reference/classmavsdk_1_1_camera.html">Camera</a>: Control a camera.</li><li><a href="./api_reference/classmavsdk_1_1_follow_me.html">FollowMe</a>: Drone tracks a position supplied by MAVSDK.</li><li><a href="./api_reference/classmavsdk_1_1_calibration.html">Calibration</a>: Calibrate sensors (e.g.: gyro, accelerometer, and magnetometer).</li><li><a href="./api_reference/classmavsdk_1_1_log_files.html">LogFiles</a>: Download log files from the vehicle.</li></ul><p>In addition, &quot;<a href="./server_plugins.html">Server Plugins</a>&quot; can be used to implement vehicle-side MAVLink functionality. The might be used to expose a MAVLink interface from non-MAVLink autopilots or components.</p><p>The following APIs provide more direct access to underlying MAVLink messages/types. They should only be used where features are missing from the main APIs above.</p><ul><li><a href="./api_reference/classmavsdk_1_1_param.html">Param</a>: Raw access to get and set parameters.</li><li><a href="./api_reference/classmavsdk_1_1_mission_raw.html">MissionRaw</a>: Direct access to MAVLink mission items.</li><li><a href="./api_reference/classmavsdk_1_1_mavlink_passthrough.html">MavlinkPassthrough</a>: Provides full/direct MAVLink access</li></ul><h2 id="contributing-extending" tabindex="-1">Contributing/Extending <a class="header-anchor" href="#contributing-extending" aria-label="Permalink to &quot;Contributing/Extending&quot;">​</a></h2><p>The <a href="./contributing/">Contributing</a> section contains everything you need to contribute to project, including topics about building MAVSDK from source code, running our integration and unit tests, and all other aspects of core development.</p><h2 id="troubleshooting" tabindex="-1">Troubleshooting <a class="header-anchor" href="#troubleshooting" aria-label="Permalink to &quot;Troubleshooting&quot;">​</a></h2><p>If something doesn&#39;t work as expected, make sure to check <a href="./troubleshooting.html">Troubleshooting</a>.</p>',21)]))}const g=t(o,[["render",n]]);export{f as __pageData,g as default};
